import React from 'react'

class Careers extends React.Component {

    render() {
        return (
            <div>
                <div className='jumbotron jumbotron-fluid px-5 mb-2 careers-background'>
                    <h1 className='display-2 text-center'>Careers at Turner Concrete & Excavating</h1>
                </div>
                <div className="row">
                    <div className='card col-4 text-left p-3'>
                        <h3 className='m-1 text-center'><strong>Work With Us</strong></h3>
                        <div className="">Turner Concrete & Excavating has been recognized as a top employer by Fortune, The Washington Post, and Great Place to Work. We top the charts as an organization that focuses on team member well-being and the shared values and pride among our team. </div>
                        <div>We're always looking for friendly and highly motivated potential Inkers who are ready to roll up their sleeves and work with a great team.</div>
                        <div>If you think you’ve got what it takes to be an integral part of our internal community and succeed in a results-driven and fun environment, we’d love to hear from you.</div>
                    </div>
                    <div className='col-8'>

                    </div>
                </div>
            </div>
        )
    }
}

export default Careers;
